import React from 'react';
import logo from './logo.svg';
import './App.css';
import App2 from './App2.js';
import App3 from './App3.js';
import App4 from './App4';

function App() {
  return (
    <div className="App">
      <ul>
        <li>L</li>
        <li>E</li>
        <li>V</li>
      </ul>
      <App2/>
      <App3/>
      <App4/>
    </div>
  );
}



export default App;
